          type: string
          example: Failure
    versions:
      type: object
      properties:
        v0.1.0:
          type: array
          items:
            oneOf:
              - type: string
                example: Published Date - September 21, 2022
                description: Initial version
    input:
      type: object
      required:

        - image_base64

      properties:
        image_base64:
          x-name: image_base64
          type: string
          default: True
          example: 
          description: |+
            base64 encoded image of input image file.
  securitySchemes:
    APIAuthorizer:
      type: apiKey
      name: x-api-key
      in: header
      x-amazon-apigateway-authtype: custom
      description: Authentication is done using the x-api-key in the request header
